import React from 'react';
import './Hero.css';

const Hero = () => {
  return (
    <div className="hero">
      <div className="hero-content">
        <h1>Welcome to Our Website</h1>
        <p>Discover amazing content and get inspired.</p>
      </div>
      <div className="hero-image">
        <img src="https://storage.googleapis.com/accredian-assets/Frontend_Assests/Images/Accredian-react-site-images/logo/scholar.svg" alt="Hero" />
      </div>
    </div>
  );
};

export default Hero;
